css:
@-moz-document domain("www.roblox.com")
{



  body
  {
    background: white !important;
  }

  body,td,.medText,b
  {
    font-family: verdana !important;
    font-size: 7.5pt !important;
  }

  a:link,a:visited,a:active,a,b a:link,b a:visited, b a:active
  {
    color: red !important;
  }

  a:hover
  {
    color: grey !important;
  }

  #footer,.sidebar,.contentModuleHeaderAlt,.contentModuleHeader,#ban_bottom,.ad_wrapper_fixed,ul.dropdown,hr
  {
    display: none !important;
  }

  #template_nav
  {
    position: absolute !important;
    top: 53px !important;
    left: 5px !important;
    background: none !important;
    width: 100px !important;
  }

  #template_nav img
  {
    display: block !important;
    height: 45px !important;
    width: 128px !important;
    visibility: hidden !important;
  }

  #header
  {
    background: url(http://i41.tinypic.com/iv9x7o.png) !important;
    width: 888px !important;
    height: 699px !important;
    position: absolute !important;
    top: 0px !important;
    left: 0px !important;
    border: 0px !important;
  }

  #nst
  {
    width: 110px !important;
    height: 20px !important;
    background: #fbfd64 !important;
    position: absolute !important;
    top: 455px !important;
    left: 7px !important;
    border: 1px solid black !important;
    line-height: 20px !important;
  }

  .user
  {
    position: absolute !important;
    top: 10px !important;
    left: 350px !important;
    color: black !important;
  }

  .user a:link,.user a:visited,.user a:active
  {
    color: blue !important;
  }

  .user a:hover
  {
    color: grey !important;
  }

  #main,.content,.contentModuleContent,.sidebar
  {
    border: 0px !important;
    background: none !important;
  }

  .contentModuleTable,.contentModule
  {
    border: 0px !important;
  }

  #content,#main,#c
  {
    width: 700px !important;
  }

  #content
  {
    position: absolute !important;
    top: 120px !important;
    left: 140px !important;
  }

  #userneopets img
  {
    background: url(http://images.neopets.com/pets/scorchio_invisible_baby.gif) !important;
  }
}
